import time
from typing import List
from collections import defaultdict


class Solution:
    def __init__(self):
        self.similarDict = defaultdict(set)

    def numSimilarGroups(self, A: List[str]) -> int:
        """Returns the count of similar string groups."""
        words = set(A)
        self.buildSimilarDict(words)

        groupCount = 0
        while words:
            groupWords = set()
            bfsQueue = [words.pop()]
            while bfsQueue:
                curWord = bfsQueue[0]
                similarWords = self.similarDict[curWord].intersection(words)
                if similarWords:
                    bfsQueue.extend(similarWords)
                    words = words - similarWords
                # basic BFS operation
                groupWords.add(curWord)
                bfsQueue.remove(curWord)
            if groupWords:
                # print(groupWords)
                groupCount += 1
        return groupCount

    def buildSimilarDict(self, words: set):
        for word in words:
            self.similarDict[word] = self.similarWords(
                word, words)  # similarDict: size(len(words), len(word))

    def similarWords(self, word: str, words: set) -> set:
        """Return all similar words of a word"""
        similarWords = set()
        for i in range(len(word)):
            for j in range(i + 1, len(word)):
                similarWord = word[:i] + word[j] + word[i + 1:j] + word[
                    i] + word[j + 1:]  # replace i, j
                if similarWord in words:
                    similarWords.add(similarWord)
        return similarWords


